import React, { Component } from 'react';

const mainPanelStyle = {
  display: 'flex',
  flex: 10,
};

class MainPanel extends Component {
  render() {
    return (
      <div style={mainPanelStyle}>
        <h1>SPA Main Panel</h1>
      </div>
    );
  }
}

export default MainPanel;
